module.exports = class AjnString {
  constructor() {
    this._value = undefined;
  }
  max(val) {
    if (typeof val === 'string') {
      if (!this._value) this._value = val;
      else if (val > this._value) this._value = val;
    }
    return this;
  }
  min(val) {
    if (typeof val === 'string') {
      if (!this._value) this._value = val;
      else if (val < this._value) this._value = val;
    }
    return this;
  }
  toString() {
    return this._value.toString();
  }
  get value() {
    return this._value;
  }
};
